function ExpenseItems() {
  return (
    <div>
      <h3>Expense Items</h3>
      <h3>Food Rs 10</h3>
      <h3>Petrol Rs 100</h3>
      <h3>Movies Rs 200</h3>
    </div>
  );
}
export default ExpenseItems;
